import Button from 'react-bootstrap/Button';
const NavBar = () => {
    return (
        <nav>
            <h3>TodoMotores.com</h3>
            <div>
                <Button className="btn btn-secondary">Motor</Button>
                <Button>Electricidad</Button>
                <Button>Tren Delantero</Button>
                <Button>Embragues</Button>
            </div>
        </nav>
    );
}
export default NavBar;
